const Container = styled.div`
   padding: 10px;
   height: 10vh;
    background-color: black;
    color: white;
    display: flex;
    align-items: center;
    justify-content: center; 
    font-style: 2px;
    font-weight: 300;
`
const Announcement = () => {
  return (
    <Container>
       We are looking forward to work for your next advertising campaign together !!!!
    </Container>
  )
}

export default Announcement
